import React from "react";
import { Navigation, Pagination, Scrollbar, A11y } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";
// import required modules
import { Autoplay } from "swiper";

// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/scrollbar";

import "./MomentPicSlide.css";

import CardMoment from "./cardMoment";
import dataLifeEvents from "./dataMoments";

import img1 from "./life_events/18.jpeg";

const MomentPicSlide = () => {
  return (
    <>
      <section>
        <div className="moment_pic">
          <div className="life-event">Life Events....</div>
          <div>
            <div>
              {dataLifeEvents.map((val, index) => {
                console.log(val.img);
                return (
                  <CardMoment
                    key={index}
                    path={val.img}
                    description={val.description}
                    id={val.id}
                  />
                );
              })}
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default MomentPicSlide;
